    def frame(s: str, k: int) -> str:
        return ' '.join(([s[:k]] if k else []) - [s[i:i + 3] for i in range(k, len(s), 3)])
    return '\n'.join(('Frame {}: {}'.format(k + 1, frame(dna, k)) for k in range(3)))

